import { fetchSingleCharacters } from '../Callapi/Helper';
import { useParams } from "react-router-dom";
import axios from "axios";

const Userdetail = () => {
    const usersing = useParams();
    const singleId = usersing.id;
    console.log("usersing", usersing.id);
    const userSingleCharacter = async (singleId) => {
        try {
            const result = await axios.get(`https://rickandmortyapi.com/api/character/${singleId}`);
            console.log("single character", result);
            return result.data;
          } catch (error) {
            // console.log(error);
          }
      };

      useEffect(() => {
        userSingleCharacter();
      }, [])

    return (
        <div>

            <div className="card">
                <div className="card-header">
                    Featured
                </div>
                <div className="card-body">
                    <h5 className="card-title">Special title treatment</h5>
                    <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                    <a href="#" className="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        </div>
    )
}

export default Userdetail
